import React from "react";

import { Table } from "react-bootstrap";

const InputTable = () => {
    return (
        <>
        <div>
        <h4>Investment Portfolio Input</h4>
        </div>
            <Table striped bordered hover>
                <thead>
                <tr>
                    <th>#</th>
                    <th>Investment Sector</th>
                    <th>Precent of Investment</th>
                </tr>
                </thead>
            </Table>
        </>
    );
};

export default InputTable;
